import React from "react";
import './About.css';
import about_img from './../image/about_img.png';

function About(){
    return (
            <div className="row">
                <div className="col-md-7">
                    <div className="card" style="width: 18rem;">
                        <div className="card-body">
                            <h5 className="card-title">Anurag Jaiswal</h5>
                            <h6 className="card-subtitle">Developer</h6>
                            <p className="card-text">Hi Everyone, I am <span>Anurag Jaiswal</span> from Gujarat, India.</p>
                            <p className="card-text">I am a student pursuing MCA.</p>
                        </div>
                    </div>
                </div>
                <div className="col-md-5">
                    <img src={about_img} className="img-fluid"/>
                </div>
            </div>
        // </div>
    );
}
export default About;
